import signUpImage from './signUpImage.jpg'
import classes from './Signup.module.css'

const Signup = () => {

    return (
      <div className={classes.sign_up}>
        <div>
          <h1>The Community Hub — Where Passions Turn into Connections.</h1>
          <p>
            Whether you're into trekking, literature, professional networking,
            or sharing skills, countless like-minded individuals await on
            Meetup. Daily events are unfolding — become a part of the
            excitement.
          </p>
          <button className={classes.btn_round}>Join Meetup</button>
        </div>
        <img src={signUpImage} alt="group" />
      </div>
    );
}
export default Signup;
